	using System;
	using System.Reflection;
	internal static class ThrowHelpers
	{
		internal static void ThrowIfBadDelegate( Delegate del )
		{
			if( del.Target != null ) throw new InvalidOperationException( "Supplied delegate captured context. Try using a static function" );
		}
	}

	#pragma warning disable IDE0021 // Use block body for constructors
	public readonly struct FastFunc<TReturn>
	{
		public delegate TReturn Signature();
		public readonly IntPtr functionPointer;
		[PatchCallToCalli]
		public TReturn Call() => Stub(this.functionPointer);
		public static implicit operator Signature( FastFunc<TReturn> func ) => func.Call;
		public static implicit operator FastFunc<TReturn>( Signature func ) => new FastFunc<TReturn>( func );
		public FastFunc(IntPtr ptr) => this.functionPointer = ptr;
		public FastFunc(RuntimeMethodHandle handle) : this( handle.GetFunctionPointer() ) {}
		public FastFunc(MethodBase methodBase) : this( methodBase.MethodHandle ) {}
		public FastFunc(Signature signature) : this( signature.Method ) => ThrowHelpers.ThrowIfBadDelegate( signature );
		private static TReturn Stub(IntPtr ptr) => default;
	}
